import axios from 'axios'

export const asyncGetBuilding = () => {
    return (dispatch) => {
        axios.get('http://localhost:3088/api/building')
            .then((response) => {
                const data = response.data
                console.log(data)
            })
            .catch((err) => {
                console.log(err)
            })
    }
}
